import React from "react";

const Navbar = () => {
  return (
    <div>
      <input type={"text"} placeholder={"search"} />
      <h1>Vacation Seeker</h1>
      <div>
        <button>Travel stories</button>
        <button>Destinations</button>
        <button>Home</button>
      </div>
    </div>
  );
};

export default Navbar;
